import { useEffect, useState } from "react";
import axios from "axios";
import { DeleteButton } from "../../components/buttons/index";
import Link from "next/link";

const Dashboard = () => {
  const [posts, setPosts] = useState(false);

  useEffect(() => {
    if (localStorage.getItem("authorization") === null) {
      return;
    } else {
      axios
        .get("/api/posts/getUserPosts", {
          headers: {
            authorization: localStorage.getItem("authorization"),
          },
        })
        .then((res) => {
          setPosts(res.data.userPosts);
          console.log(res);
        });
    }
  }, []);

  return (
    <div className="relative">
      <div className="bg-indigo-700 rounded-full text-white absolute m-6 right-0 px-3">
        <div className="flex gap-3">
          <Link href="/dashboard/newPost">
            <a className="text-2xl">+</a>

            <p className="text-2xl">new post</p>
          </Link>
        </div>
      </div>

      {posts
        ? posts.map((post, index) => {
            return (
              <div key={index}>
                {" "}
                {post.title}
                <br />
                <DeleteButton postid={post._id} />
                <br />
                <Link href={`dashboard/editPost/${post._id}`}>
                  <a>Edit Post</a>
                </Link>
              </div>
            );
          })
        : null}
    </div>
  );
};

export default Dashboard;
